
function EditApp(){var a=this;$("#RefreshSecretIdButton").click(function(){$("#SecretIdText").val(a.generateUUID())})}EditApp.prototype.generateUUID=function(){var b=new Date().getTime();var a="xxxxxxxxxxxxxxxxxxxxxxxxxxxxxx".replace(/[xy]/g,function(e){var d=(b+Math.random()*16)%16|0;b=Math.floor(b/16);return(e==="x"?d:(d&3|8)).toString(16)});return a};$(function(){var a=new EditApp()});